//jshint esversion:6

import React, { useState } from "react";


function App() {

    const [count, setCount] = useState(1000);

    return (<>
        <h1>{count}</h1>
        <button type="button" onClick={useState(count)}>Increase</button>
    </>);

}

export default App;
